    em = Emulator(VmDict(key_len=32, signed=False, cell_root=Cell(test_data['config_root'])))
    em.set_rand_seed(test_data['rand_seed'])
    em.set_libs(VmDict(key_len=256, signed=False, cell_root=Cell(libs)))
    success = em.emulate_transaction(
        Cell(test_data['state']),
        Cell(test_data['message']),
        int(test_data['now']),
        int(test_data['lt'])
    )
    assert success
    print(em.transaction.get_hash())
